import React from 'react';

// The logo is embedded as a Base64 data URI to avoid needing a separate file.
// FIX: Corrected a malformed base64 string that was duplicated with a '-' operator in between.
const LOGO_BASE64 = 'data:image/png;base64,';

export const Logo: React.FC<{ className?: string }> = ({ className }) => {
  return (
    <img 
      src={LOGO_BASE64}
      alt="VesikAI Logo"
      className={className}
    />
  );
};
